import React, { useState } from 'react';
// import  Card  from './Card';
import styled from 'styled-components';
import { UserData } from '../data';
import BarChart from './BarChart';

const CardBoxDiv = styled.div`  
  display: grid;
  grid-template-columns: repeat(3, 2fr); 
   background-:transparent;
  @media (max-width: 768px) {
    grid-template-columns: repeat(auto-fit, minmax(150px, 1fr));   }

  @media (max-width: 480px) {
    grid-template-columns: repeat(auto-fit, minmax(100px, 1fr)); 
  }
`;
const Card = styled.div`
  width: 250px;
  height: 150px;
  border-radius: 5%;
  margin:32px;
    background:white;
`;
const Barradiv = styled.div`
   width: 50px;
  height: 150px;
  border-radius: 5%;     
   background-image: linear-gradient(135deg, #f83600 0%, #f9d423 100%); 
   border-radius:16px;

`;
function CardBox() {
const labels = []; // Reemplaza con tus etiquetas reales
  const data = [];
  const [userhData, setUserData] = useState({    
      labels: '%hum'  ,   
      datasets: [
        {         
          data: 60,
      backgroundColor: 'lightblue',              
        }
      ]
    
  });

  
  
    return (
      <CardBoxDiv>
        <Barradiv>
       <BarChart chartData={userhData}/></Barradiv>
        
        <Card>    <Barradiv><BarChart chartData={userhData}/></Barradiv> </Card>
        <Card></Card>
        <Card></Card>
        <Card></Card>
        <Card></Card>
        


      </CardBoxDiv>
        
        
    );
 
}

export default CardBox;
